import React, { useState, useEffect } from 'react';

const Header = () => {
  const [headerColor, setHeaderColor] = useState("#32CD32");
  const [sidebarOpen, setSidebarOpen] = useState(false);

  const handleScroll = () => {
    requestAnimationFrame(() => {
      setHeaderColor(window.scrollY > 50 ? "#28a745" : "#32CD32");
    });
  };

  useEffect(() => {
    window.addEventListener("scroll", handleScroll);
    return () => {
      window.removeEventListener("scroll", handleScroll);
    };
  }, []);

  return (
    <div className="w-full">
      {/* Header Section */}
      <header
        style={{
          backgroundColor: headerColor,
          transition: "background-color 0.3s ease",
        }}
        className="fixed top-0 left-0 right-0 z-50 py-4 px-6 flex items-center justify-between w-full rounded-b-lg"
      >
        {/* Company Name */}
        <div className="flex items-center">
          <h1 className="text-white text-xl font-bold">Madzenga Consulting</h1>
        </div>

        {/* Desktop Navigation */}
        <nav className="hidden md:block">
          <ul className="flex space-x-8">
            <li>
              <a href="#about" className="text-white hover:text-yellow-200 transition-colors">
                About us
              </a>
            </li>
            <li>
              <a href="#services" className="text-white hover:text-yellow-200 transition-colors">
                Services
              </a>
            </li>
            <li>
              <a href="#projects" className="text-white hover:text-yellow-200 transition-colors">
                Projects
              </a>
            </li>
            <li>
              <a href="#quality" className="text-white hover:text-yellow-200 transition-colors">
                Quality Assurance
              </a>
            </li>
          </ul>
        </nav>

        {/* Call to Action Button */}
        <a
          href="#contact"
          className="hidden md:block bg-orange-500 hover:bg-orange-600 text-white font-semibold py-2 px-6 rounded-lg transition-colors"
        >
          Get Started
        </a>

        {/* Mobile Menu Button */}
        <button
          className="md:hidden text-white p-2"
          onClick={() => setSidebarOpen(!sidebarOpen)}
        >
          <div className="w-6 h-5 flex flex-col justify-between">
            <span className={`h-0.5 w-full bg-white transition-transform ${sidebarOpen ? 'rotate-45 translate-y-2' : ''}`}></span>
            <span className={`h-0.5 w-full bg-white transition-opacity ${sidebarOpen ? 'opacity-0' : 'opacity-100'}`}></span>
            <span className={`h-0.5 w-full bg-white transition-transform ${sidebarOpen ? '-rotate-45 -translate-y-2' : ''}`}></span>
          </div>
        </button>
      </header>

      {/* Mobile Sidebar */}
      <div
        className={`fixed top-0 right-0 w-64 h-full bg-green-700 z-50 transform transition-transform duration-300 ease-in-out ${
          sidebarOpen ? 'translate-x-0' : 'translate-x-full'
        } md:hidden`}
      >
        <div className="p-5">
          <button 
            className="text-white text-2xl absolute top-4 right-4"
            onClick={() => setSidebarOpen(false)}
          >
            ✕
          </button>

          <ul className="mt-12 space-y-4">
            <li>
              <a href="#about" className="text-white block py-2 hover:text-yellow-200 transition-colors">
                About us
              </a>
            </li>
            <li>
              <a href="#services" className="text-white block py-2 hover:text-yellow-200 transition-colors">
                Services
              </a>
            </li>
            <li>
              <a href="#projects" className="text-white block py-2 hover:text-yellow-200 transition-colors">
                Projects
              </a>
            </li>
            <li>
              <a href="#quality" className="text-white block py-2 hover:text-yellow-200 transition-colors">
                Quality Assurance
              </a>
            </li>
            <li className="pt-4">
              <a
                href="#contact"
                className="bg-orange-500 hover:bg-orange-600 text-white font-semibold py-2 px-6 rounded-lg transition-colors inline-block"
              >
                Get Started
              </a>
            </li>
          </ul>
        </div>
      </div>

      {/* Overlay for when sidebar is open */}
      {sidebarOpen && (
        <div 
          className="fixed inset-0 bg-black bg-opacity-50 z-40 md:hidden"
          onClick={() => setSidebarOpen(false)}
        ></div>
      )}
    </div>
  );
};

export default Header;
